package mms;


import util.Base64;

import java.io.File;
import java.io.FileInputStream;
import java.io.FileOutputStream;
import java.io.IOException;

public class GetFile {
    public static void main(String[] args) throws Exception {
        String failNmae = "F:\\redad\\3.gif";
        byte[] b = getContent(failNmae);

//        System.out.println(new String(b, "UTF-8").getBytes("gb2312"));

        System.out.println(Base64.encodeS(b));
        String base64Str = "";
        byte[] jpgg = Base64.decode(base64Str);

        WriteFile(jpgg);
    }

    public static byte[] getContent(String filePath) throws IOException {
        long startTime = System.currentTimeMillis();  //读取开始时的时间
        File file = new File(filePath); //找到目标文件
        System.out.println("文件大小："+file.length());
        FileInputStream fileInputStream = new FileInputStream(file); //建立数据通道
        int length = 0;
        byte[] buf = new byte[(int)file.length()];  //建立缓存数组，缓存数组的大小一般都是1024的整数倍，理论上越大效率越好
        while ((length = fileInputStream.read(buf)) != -1) {
//            System.out.print(new String(buf, 0, length));
        }
        fileInputStream.close(); //关闭资源
        long endTime = System.currentTimeMillis();
        System.out.println("读取的时间是：" + (endTime - startTime));
        return buf;
    }
    public static void WriteFile(byte[] x) {
        try {
            System.out.print("输入要保存文件的内容：");
            int  n = x.length;
            byte buffer[] = new byte[n];
            // 读取标准输入流
//            count = System.in.read(buffer);
            // 创建文件输出流对象
            FileOutputStream os = new FileOutputStream("F:\\redad\\WriteFile.gif");
            // 写入输出流
            os.write(x, 0, n);
            // 关闭输出流
            os.close();
            System.out.println("已保存到WriteFile.jpg!");

        } catch (IOException ioe) {
            System.out.println(ioe);

        } catch (Exception e) {
            System.out.println(e);

        }
    }

}
